import React, { Component } from "react";
import { Link } from 'react-router-dom';
import { withRouter } from 'react-router-dom';
import { connect } from 'unistore/react';
import { actions } from '../store';

class MyCartPage extends Component {
    render() {
        // if ((!this.props.is_login) && (this.props.userStatus !== "pembeli")) {
        //     this.props.history.push('/')
        // }

        return (
            <div class="container my-5">
                <div class="row">
                    <div class='col-12 col-md-8'>
                        <div class="card">
                            <div class="container">
                                <div class="row">
                                    <aside class="col-md-3 col-12 border ">
                                        <article class="gallery-wrap p-2 text-center">
                                            <img src={require("../images/logo/logo.png")} height="100px" />
                                        </article>
                                    </aside>
                                    <aside class="col-md-9 col-12 border">
                                        <div class="row my-auto">
                                            <div class="border p-2">
                                                <dl class="row">
                                                    <dt class="col-sm-5">Shop</dt>

                                                    <dt class="col-sm-5">Category</dt>
                                                    <dd class="col-sm-7">kategori}</dd>

                                                    <dt class="col-sm-5">Stock</dt>
                                                    <dd class="col-sm-7">qty}</dd>
                                                </dl>
                                            </div>
                                            <div class='row justify-content-right'>
                                                <a href="#" class="btn btn-danger"> <i class="fas fa-trash-alt"></i></a>
                                            </div>
                                        </div>

                                    </aside>

                                </div>
                            </div>
                        </div>
                    </div>
                    <div class="col-md-4 col-12">
                        <dl class="row p-2 pt-3">

                            <dt class="col-6">Total Payment</dt>
                            <dd class="col-6">Rp </dd>

                        </dl>
                        <hr />

                    </div>
                </div>
            </div>
        );
    }
}

export default connect('is_login, userStatus', actions)
    (withRouter(MyCartPage));
